##############################
#server 配置
##############################
server: #应用配置
  port: 8000
  servlet:
    context-path: /
##############################
#spring 配置
##############################
spring:
  application:
    name: sdk-web
  main:
    allow-bean-definition-overriding: true
  profiles: #环境配置使用 local|dev(默认)|test|uat|pre|prod
    active: '@spring.profiles.active@'
  resources: #web资源配置
    chain:
      html-application-cache: true
      strategy: #web资源配置启用版本策略 md5
        content:
          paths: /css/**,/js/**,images/**
          enabled: true
    cache: # 资源缓存时间，单位秒
      period: 604800
      cachecontrol:
        no-transform: false
        no-cache: false
        no-store: false
        cache-public: true
  thymeleaf: #web模板
    mode: HTML5
    cache: false
    servlet:
      content-type: text/html
    encoding: UTF-8
  servlet: #web资源限制
    multipart:
      max-request-size: 10MB
      max-file-size: 10MB
  jackson: #json配置
    date-format: yyyy-MM-dd HH:mm:ss
    time-zone: Asia/Chongqing
